import { useSelector, useDispatch } from 'react-redux';
import CoinList from '../components/CoinList';

function CoinContainer() {
    let CoinUpditName = useSelector((state) => state.Coin.upbitTotalNames);
    let CoinUpditdata = useSelector((state) => state.Coin.marketNames);
    let marketNamesArr = [];
    if (CoinUpditdata) {
        marketNamesArr = Object.keys(CoinUpditdata.data);


    }

    return (
        <div>
            {
                marketNamesArr.map((coin) =>
                    <div>
                        {coin}
                    </div>
                )
            }

        </div>
    )
}

export default CoinContainer;
